import React, { Component } from "react"

export class Radio extends Component {
  state = { radioStations: [
      { name: "Galaxy 92 FM", url: "www.fake.url" },
      { name: "Kids Radio", url: "www.fake.url" }
      ] }
  render() {
    return (
      <div>
        <p>this is a radio</p>
      </div>
    )
  }
}

export default Radio
